import {
  AppBar,
  Box,
  Button,
  IconButton,
  Toolbar,
  Typography,
} from "@mui/material";
import { Link } from "react-router-dom";
import MenuIcon from "@mui/icons-material/Menu";
import { useLogout } from "../hooks/useLogout";
import { useAuthContext } from "../hooks/useAuthContext";

const Navbar = () => {
  const { user } = useAuthContext();
  const { logout } =  useLogout()
  console.log(user);
  const HandleLogout = () => {
    logout()
  }
  return (
    <nav>
      <Box sx={{ flexGrow: 1 }}>
        <AppBar position="static">
          <Toolbar>
            <IconButton
              size="large"
              edge="start"
              color="inherit"
              aria-label="menu"
              sx={{ mr: 2 }}
            >
              <MenuIcon />
            </IconButton>
            <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
               {user && user.email}
            </Typography>
            
            {
                user && (
                    <div>
                        <Button color="inherit" onClick={() => HandleLogout()}><Link style={{ textDecoration: "none", color: "white" }}>Logout</Link></Button>
                    </div>
                )
            }
            {!user && (
              <div>
                <Button color="inherit">
                  <Link
                    style={{ textDecoration: "none", color: "white" }}
                    to={"/login"}
                  >
                    Login
                  </Link>
                </Button>
                <Button color="inherit">
                  <Link
                    style={{ textDecoration: "none", color: "white" }}
                    to={"/signup"}
                  >
                    Signup
                  </Link>
                </Button>
              </div>
            )}
          </Toolbar>
        </AppBar>
      </Box>
    </nav>
  );
};

export default Navbar;
